 // }

function App() {

  return(
    <Router>
    <div>

    <Header/>
    <Switch>
      <Route path='/' exact component={Home} />
        <Route path='/Aluno' exact component={Aluno} />

       </Switch>
      </div>
    </Router>
  )
}

export default App;
